import React from "react";
import PropTypes from "prop-types"
import css from './Statistic.module.css'


const Statistic = ({ good, neutral, bad, total, positivePersent }) => {

    return (
        // <section className={ css.section }>
        // </section>
        <>
            <ul>
                <li className={ css.feedback_item }> Good: <span>{good}</span></li>
                <li className={ css.feedback_item }> Neutral: <span>{neutral}</span></li>
                <li className={ css.feedback_item }> Bad: <span>{bad}</span></li>
                <li className={ css.feedback_item }> Total: <span>{total}</span></li>
                <li className={ css.feedback_item }> PositivePersent: <span>{positivePersent}%</span></li>
            </ul>
        </>
    )
}

Statistic.propTypes = {
    good: PropTypes.number.isRequired,
    neutral: PropTypes.number.isRequired,
    bad: PropTypes.number.isRequired,
    total: PropTypes.number.isRequired,
    positivePersent: PropTypes.number.isRequired
}

export default Statistic;
